var cc0 = 'http://creativecommons.org/publicdomain/zero/1.0/';
var ccBy = 'http://creativecommons.org/licenses/by/3.0/';

var taxonGroups = [
    { name: 'Fungi', color: '#F52887', image: { id: 'afd875a3-815f-443b-9b93-3e5bedd9a7a3', ns: 'phylopic', licenseURL: cc0, base64: ''} },
    { name: 'Plantae', color: '#73AC13', image: { id: 'b6400f39-345a-4711-ab4f-92fd4e22cb1a', ns: 'phylopic', licenseURL: cc0, base64: '' } },
    { name: 'Insecta', color: '#FF4500', image: { id: '6c6c5073-2383-40fb-9824-c6a8ed27badc', ns: 'phylopic', licenseURL: cc0, base64: '' } },
    { name: 'Mollusca', color: '#FF4500', image: { id: '1eb7433a-4943-4220-aa66-a658b272f23c', ns: 'phylopic', licenseURL: ccBy, attribution: 'Marcello', base64: '' } },
    { name: 'Arachnida', color: '#FF4500', image: { id: '44fa6ec0-6bad-42bd-ae91-48d00c9b035c', ns: 'phylopic', licenseURL: cc0, base64: '' } },
    { name: 'Aves', color: '#1E90FF', image: { id: 'ee764929-c865-44f6-b5db-b4e7d5693d1a', ns: 'phylopic', licenseURL: ccBy, attribution: 'Scott Hartman', base64: '' } },
    { name: 'Reptilia', color: '#FF4500', image: { id: 'dffda000-77cb-4251-b837-0cd2ab21ed5b', ns: 'phylopic', licenseURL: cc0, base64: '' } },
    { name: 'Actinopterygii', color: '#FF4500', image: { id: '90e1c28f-dd6f-4b1c-b263-91d208610458', ns: 'phylopic', licenseURL: cc0, base64: '' } },
    { name: 'Amphibia', color: '#FF4500', image: { id: '244be3ea-0fe5-45b6-b04e-1bd914489f95', ns: 'phylopic', licenseURL: cc0, base64: ''  } },
    { name: 'Mammalia', color: '#FF4500', image: { id: 'e5b0cde8-beab-48dc-b77c-d48b16c6a05e', ns: 'phylopic', licenseURL: cc0, base64: '' } }
];

var defaultColor = '#000000';

var taxaprisma = {};

module.exports = taxaprisma;


function matchesTaxon(taxonPath) {
    return taxonGroups.filter(function (obj) {
        return taxonPath.match(obj.name);
    });
}
taxaprisma.colorFor = function (taxonPath) {
    var matches = matchesTaxon(taxonPath);
    var color = defaultColor;
    if (matches.length > 0) {
        color = matches[0].color;
    }
    return color;
};

taxaprisma.imageFor = function (taxonPath) {
    var matches = matchesTaxon(taxonPath);
    var img = null;
    if (matches.length > 0) {
        if (matches[0].image.ns === 'phylopic') {
            img = 'http://phylopic.org/assets/images/submissions/' + matches[0].image.id + '.thumb.png';
        }
    }
    return img;
};

taxaprisma.imageDataUrlFor = function (taxonPath) {
    var matches = matchesTaxon(taxonPath);
    var img = null;
    if (matches.length > 0) {
        img = 'data:image/png;base64,' + matches[0].image.base64;
    }
    return img;
};

taxaprisma.imageLicenseFor = function (taxonPath) {
    var matches = matchesTaxon(taxonPath);
    var licenseText = null;
    if (matches.length > 0) {
        var first = matches[0];
        licenseText = cc0;
        if (first.image.licenseURL !== cc0) {
            licenseText = ['by', first.image.attribution, 'under',first.image.licenseURL].join(' ');
        }
    }
    return licenseText;
};

